  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains hydrographic data
  collected during cruise KM0703 in the tropical and subtropical Southwest Pacific.
  Leg 1 of the cruise began in Townsville, Australia and sampled the Coral Sea, a
  transect southward toward the Tasman Sea, and a transect northward toward New Caledonia,
  with twelve hydro stations (001-012). Leg 2 included a run eastward to 170 deg W,
  a northward run to 15 deg S, then a transect to the east before ending in Suva,
  Fiji after carrying out fourteen stations (013-026). Repeated casts at a single
  station are identified with a sequence number following the decimal. For example,
  the first sampling event at station 022 is numbered 022.01, the second is numbered
  022.03, etc.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
